import React, { useState, useEffect } from 'react'
import PropTypes from 'prop-types'


export default function NavBar(props) {
  const [isDarkMode, setIsDarkMode] = useState(false);
  const handleDarkModeToggle = () => {
    setIsDarkMode(!isDarkMode);
  };

  // Apply dark mode styles
  if (isDarkMode) {
    document.body.style.backgroundColor = 'black';
    document.body.style.color = 'white';
  } else {
    document.body.style.backgroundColor = 'white';
    document.body.style.color = 'black';
  }
    return(
        <nav className={`navbar navbar-expand-lg ${isDarkMode ? 'dark-mode' : ''}`}>
    <div className="container-fluid" >
      <a className="navbar-brand" href="/">
        <img src="https://whatthelogo.com/storage/logos/frank-millers-300-8841.png" alt="Logo" width="150" height="50" className="d-inline-block align-text-top"/>
        {props.name}
      </a>
      <div className="collapse navbar-collapse" id="navbarNavDropdown">
        <ul className="navbar-nav">
          <li className="nav-item">
            <a className="nav-link active" aria-current="page" href="/about">Spartan Abode</a>
          </li>
          <li className="nav-item">
            <a className="nav-link active" aria-current="page" href="/testimonial">Testimonials</a>
          </li>
          <li className="nav-item">
            <a className="nav-link"href="#">Perks</a>
          </li>
          <li className="nav-item">
            <a className="nav-link" href="#">Pricing</a>
          </li>
          <li className="nav-item dropdown" data-bs-theme="dark">
            <button type="button" className="btn btn-danger dropdown-toggle" data-bs-toggle="dropdown" aria-expanded="false">
              Historic Places
            </button>
            <ul className="dropdown-menu" aria-labelledby="dropdownMenuButtonDark">
              <li><a className="dropdown-item" href="https://www.gtp.gr/TDirectoryDetails.asp?ID=14991">Acropolis</a></li>
              <li><a className="dropdown-item" href="https://en.wikipedia.org/wiki/Menelaion">Menelaion</a></li>
              <li><a className="dropdown-item" href="https://en.wikipedia.org/wiki/Mystras">Mystras</a></li>
              <li><a className="dropdown-item" href="https://en.wikipedia.org/wiki/Taygetus">Taygetus</a></li>
              <li><hr className="dropdown-divider"/></li>
              <li><a className="dropdown-item" href="#">Uncharted Waters</a></li>
            </ul>
          </li>
        </ul>
      </div>
      <form className="d-flex" role="search">
        <input className="form-control me-2" type="search" placeholder="Search" aria-label="Search"/>
        <button className="btn-search" type="submit">Search</button>
      </form>
      <button className='btn' onClick={handleDarkModeToggle}>{isDarkMode ? 'Light Mode' : 'Dark Mode'}</button>
    </div>
    {/* <button className='btn' onClick={handleBackgroundColor}>Enable Dark Mode</button> */}
  </nav>
    )
}

NavBar.propTypes={
    name:PropTypes.string.isRequired,
    backgroundcolor:PropTypes.string.isRequired,
}

NavBar.defaultProps={
    name:'Set App Name here',
};
